import './SignBtn.css';
import Media from 'react-media';

// Register Btn view
export default function SignBtn() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {

 React.useEffect(() => {
  TweenMax.from('.btn-transition button', 1.2, { delay: .7, opacity: 0, y: 30, ease: Expo.easeIn })
 }, []);

 return (
  <div className='btn-transition'>
   <button className='btn-signbtn'>Sign In</button>
  </div>
 )
}
export const ScreenSmall = () => (
 <button className='btn-signbtn-sm'>Sign In</button>
);
